    void Grid::HandleGridCollisionCorners(logic::PhysicsObject &object, const gmath::Position &cellPosition, const gmath::Vec2 &sign) {
        const float halfCellSize = CellSize * 0.5f;
        gmath::Vec2 distance{ cellPosition.GetDifference(gmath::Vec2(halfCellSize)) };
        distance -= halfCellSize;
    
        const float length = distance.GetLength();
    
        if (const float intersectionLength = length - object.Radius; intersectionLength < 0.0f) {
            const gmath::Vec2 intersection = distance * (intersectionLength / length);
            object.Position.X -= sign.X * intersection.X;
            object.Position.Y -= sign.Y * intersection.Y;
            object.Velocity.X -= sign.X * intersection.X;
            object.Velocity.Y -= sign.Y * intersection.Y;
        }
    }
    
    void Grid::HandleGridCollision(logic::PhysicsObject &object, const float delta, const int *Array) {
        gmath::GridEntry objectEntry;
    
        if (!gmath::GridEntry::FromWorld(
                object.Position + object.Velocity * delta, Origin, CellSize, GridSize, objectEntry))
            return;
    
        const gmath::Position cellPosition{ gmath::GridEntry::GetCellPosition(
            object.Position + object.Velocity * delta, Origin, CellSize) };
    
        // Horizontal collision handling
        if (Array[(objectEntry.Column + 1) + (objectEntry.Row) * GridSize.Columns] &&
            cellPosition.X > CellSize - object.Radius) {
            object.Position.X = CellSize * static_cast<float>(objectEntry.Column) + CellSize - object.Radius + Origin.X;
            object.Velocity.X = 0.0f;
        } else if (Array[(objectEntry.Column - 1) + (objectEntry.Row) * GridSize.Columns] &&
                   cellPosition.X < object.Radius) {
            object.Position.X = CellSize * static_cast<float>(objectEntry.Column) + object.Radius + Origin.X;
            object.Velocity.X = 0.0f;
        }
    
        // Vertical collision handling
        if (Array[(objectEntry.Column) + (objectEntry.Row + 1) * GridSize.Columns] &&
            cellPosition.Y > CellSize - object.Radius) {
            object.Position.Y = CellSize * static_cast<float>(objectEntry.Row) + CellSize - object.Radius + Origin.Y;
            object.Velocity.Y = 0.0f;
        } else if (Array[(objectEntry.Column) + (objectEntry.Row - 1) * GridSize.Columns] &&
                   cellPosition.Y < object.Radius) {
            object.Position.Y = CellSize * static_cast<float>(objectEntry.Row) + object.Radius + Origin.Y;
            object.Velocity.Y = 0.0f;
        }
    
        // Corner collision handling
        if (Array[(objectEntry.Column + 1) + (objectEntry.Row + 1) * GridSize.Columns] &&
            cellPosition.Y > CellSize - object.Radius && cellPosition.X >= CellSize - object.Radius)
            HandleGridCollisionCorners(object, cellPosition, { 1.0f, 1.0f });
    
        else if (Array[(objectEntry.Column - 1) + (objectEntry.Row + 1) * GridSize.Columns] &&
                 cellPosition.Y > CellSize - object.Radius && cellPosition.X < object.Radius)
            HandleGridCollisionCorners(object, cellPosition, { -1.0f, 1.0f });
    
        else if (Array[(objectEntry.Column - 1) + (objectEntry.Row - 1) * GridSize.Columns] &&
                 cellPosition.Y < object.Radius && cellPosition.X < object.Radius)
            HandleGridCollisionCorners(object, cellPosition, { -1.0f, -1.0f });
    
        else if (Array[(objectEntry.Column + 1) + (objectEntry.Row - 1) * GridSize.Columns] &&
                 cellPosition.Y < object.Radius && cellPosition.X >= CellSize - object.Radius)
            HandleGridCollisionCorners(object, cellPosition, { 1.0f, -1.0f });
    }

    bool Grid::GridIntersection(const gmath::Segment &segment, const int *Array, gmath::Point2 &intersection) {
        gmath::GridEntry objectEntry;
        gmath::GridEntry::FromWorld(segment.Start, Origin, CellSize, GridSize, objectEntry);
    
        return false;
    }
    
    bool Grid::SegmentIsIntersecingCircle(const gmath::Segment &segment, const gmath::Point2 c, const float r) {
        float s = segment.GetSlope();
        float i = segment.Start.Y - s * segment.Start.X;
        float r2 = r * r;
    
        return i * (-i + 2 * (c.Y - c.X * s)) + r2 + s * (r2 * s + c.X * (2 * c.Y - c.X * s)) - c.Y * c.Y >= 0.0f;
    }

    uint8_t Grid::SegementCircleIntersection(
        const gmath::Segment &segment, const gmath::Point2 c, const float r, gmath::Point2 &outIntersection) {
        float s{ segment.GetSlope() };
        float i{ segment.Start.Y - s * segment.Start.X };
        float r2{ r * r };
        float sx{ segment.Start.X };
        float ex{ segment.End.X };
        unsigned int result{};
    
        float cx{ c.X };
        float cy{ c.Y };
    
        float depth{ i * (-i + 2 * (cy - cx * s)) + r2 + s * (r2 * s + cx * (2 * cy - cx * s)) - cy * cy };
    
        if (depth < 0.0f)
            return false;
    
        float depthSqrt{ sqrtf(depth) };
    
        float xv0{ -cx - s * (cy - i) };
        float xv1{ -1 - s * s };
    
        float xi[2]{ (xv0 - depthSqrt) / xv1, (xv0 + depthSqrt) / xv1 };
    
        float ov0{ (i - cy) / s + cx };
        float opposite{ ov0 * ov0 - r2 };
    
        int ss{ std::signbit(xi[1] - sx) + std::signbit(xi[0] - sx) };
        int es{ std::signbit(xi[1] - ex) + std::signbit(xi[0] - ex) };
    
        if (sx == ex) {
            xi[0] = sx;
            xi[1] = ex;
            // TODO: solve niche case where the segment is perfectly vertical
        }
    
        result |= (ss & 0x1) << 1;
        result |= (es & 0x1) << 2;
    
        if (ss == es)
            return result;
    
        result |= INTERSECTING;
    
        bool os = std::signbit(opposite);
        quadrantResult qr{ quadrantMap[os][std::signbit(
            static_cast<float>(1 - os) * (cy - s * cx - i) + static_cast<float>(os) * s)][ss][es] };
        float x = xi[qr.x];
        float yi = static_cast<float>(qr.y) * sqrtf(r2 - x * x + cx * (2 * x - cx)) + cy;
        outIntersection = { xi[qr.x], yi };
    
        return result;
    }

    bool Grid::IsIntersectingAnyCell(gmath::Segment segment, const int *Array, gmath::Point2 &intersection) {
        gmath::Vec2 OriginOffset = (Origin / CellSize).Ceil() * logic::Grid::CellSize;
        segment.Start -= Origin - OriginOffset;
        segment.End -= Origin - OriginOffset;
    
        gmath::Vec2 difference = segment.End - segment.Start;
        float slope = difference.Y / difference.X;
        int manhattenDistance = static_cast<int>(ceilf(fabsf(difference.X) + fabsf(difference.Y)) / CellSize) * 2 + 2;
    
        gmath::Vec2 start{ CellSize * (segment.Start / CellSize).Floor() };
        gmath::Vec2 end{ CellSize * (segment.End / CellSize).Floor() };
    
        const float mc = segment.Start.X > segment.End.X ? 0.0f : CellSize;
        const float xc = segment.Start.X > segment.End.X ? -CellSize : CellSize;
        const float yc = segment.Start.Y > segment.End.Y ? -CellSize : CellSize;
    
        int count = 0;
    
        while (start.X != end.X || start.Y != end.Y) {
            const float over{ CellSize *
                              floorf((slope * (start.X + mc) + (segment.Start.Y - slope * segment.Start.X)) / CellSize) };
    
            while (start.Y != over) {
                count++;
                start.Y += yc;
    
                if (count > manhattenDistance)
                    return true;
    
                gmath::GridEntry output;
                if (gmath::GridEntry::FromWorld(start, Origin, CellSize, GridSize, output) &&
                    Array[output.Column + output.Row * GridSize.Columns]) {
                    float y = segment.Start.Y > segment.End.Y ? start.Y + CellSize : start.Y;
                    y += Origin.Y - OriginOffset.Y;
                    intersection = { (y - ((segment.Start.Y + Origin.Y - OriginOffset.Y) -
                                              slope * (segment.Start.X + Origin.X - OriginOffset.X))) /
                                         slope,
                        y };
                    return true;
                }
                if (start.Y == end.Y && start.X == end.X)
                    goto exit;
            }
    
            count++;
            start.X += xc;
    
            if (count > manhattenDistance)
                return true;
    
            gmath::GridEntry output;
            if (gmath::GridEntry::FromWorld(start, Origin, CellSize, GridSize, output) &&
                Array[output.Column + output.Row * GridSize.Columns]) {
                float x = segment.Start.X > segment.End.X ? start.X + CellSize : start.X;
                x += Origin.X - OriginOffset.X;
                intersection = { x,
                    (slope * x + ((segment.Start.Y + Origin.Y - OriginOffset.Y) -
                                     slope * (segment.Start.X + Origin.X - OriginOffset.X))) };
                return true;
            }
        }
    exit: { return false; }
    }

    gmath::GridEntry Grid::GenerateGridEntry(gmath::GridEntry origin) {
        std::random_device rd;
        std::mt19937 gen(rd());
        int offset = 5;

        int minIndexRow = origin.Row - offset;
        if (minIndexRow < 1)
            minIndexRow = 1;
        int maxIndexRow = origin.Row + offset;
        if (maxIndexRow > logic::Grid::GridSize.Rows)
            maxIndexRow = logic::Grid::GridSize.Rows - 1;

        int minIndexCol = origin.Columns - offset;
        if (minIndexCol < 1)
            minIndexCol = 1;
        int maxIndexCol = origin.Columns + offset;
        if (maxIndexCol > logic::Grid::GridSize.Columns)
            maxIndexCol = logic::Grid::GridSize.Columns - 1;

        std::uniform_int_distribution<int> dis_row(minIndexRow, maxIndexRow);
        std::uniform_int_distribution<int> dis_col(minIndexCol, maxIndexCol);

        int row, column;
        do {
            row = dis_row(gen);
            column = dis_col(gen);
        } while (logic::Grid::Array[row][column] != 0);
        return { row, column };
    }

    gmath::Position Grid::GeneratePosition() {
        std::random_device rd;
        std::mt19937 gen(rd());

        int minIndex = 3;
        int maxIndexRow = logic::Grid::GridSize.Rows - minIndex;
        int maxIndexCol = logic::Grid::GridSize.Columns - minIndex;

        std::uniform_int_distribution<int> dis_row(minIndex, maxIndexRow);
        std::uniform_int_distribution<int> dis_col(minIndex, maxIndexCol);

        int row, column;
        do {
            row = dis_row(gen);
            column = dis_col(gen);
        } while (logic::Grid::Array[row][column] != 0);
        float posX = column * logic::Grid::CellSize + (logic::Grid::CellSize * 0.5f);
        float posY = row * logic::Grid::CellSize + (logic::Grid::CellSize * 0.5f);
        return { posX, posY };
    }
